import React, { Fragment, useEffect, useState } from 'react';
import Breadcrumb from "../../common/breadcrumb";
import MaterialTable from "material-table";
import CancelIcon from '@material-ui/icons/Cancel';
import EditIcon from '@material-ui/icons/Edit';

function ListarProductos(props) {
    const [listProductos, setListProductos] = useState([]);

    const columnas = [
        {
            field: 'id',
            title: 'ID Tipo',
            cellStyle: { minWidth: 50 }
        },
        {
            field: 'nombretipoproducto',
            title: 'Nombre tipo producto',
            cellStyle: { minWidth: 150 }
        },
        {
            field: 'descripcion',
            title: 'Descripción',
            cellStyle: { minWidth: 300 }
        },
        {
            field: 'nombreestado',
            title: 'Estado',
            cellStyle: { minWidth: 50 }
        }
    ]


    return (
        <Fragment>
            <Breadcrumb title="Listar Productos" parent="Physical" />
            <div id="basicScenario" className="product-physical">
                <MaterialTable
                    title="Render Image Preview"
                    columns={[
                      { title: 'Avatar', field: 'imageUrl', render: rowData => <img src={rowData.imageUrl} style={{width: 40, borderRadius: '50%'}}/> },
                      { title: 'Name', field: 'name' },
                      { title: 'Surname', field: 'surname' },
                      { title: 'Birth Year', field: 'birthYear', type: 'numeric' },
                      {
                        title: 'Birth Place',
                        field: 'birthCity',
                        lookup: { 34: 'İstanbul', 63: 'Şanlıurfa' },
                      },
                    ]}
                         
                />
            </div>

        </Fragment>
    );
}

export default ListarProductos;
